Ext.data.JsonP['Dashboard_4.9.1_Release_Note']({"guide":"<?xml version=\"1.0\" encoding=\"UTF-8\" ?>\n<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\"\n        \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\n<head>\n    <title>Dashboard 4.9.1  - 18 October 2016</title>\n\n    <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\n    <meta content=\"Scroll EclipseHelp Exporter\" name=\"generator\">\n\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\" media=\"print\">\n</link></link></link></meta></meta></head>\n<body>\n    <div class=\"container\">\n\t\t<div id=\"banner\" class=\"confbox admonition admonition-note aui-message warning shadowed information-macro\">\n\t\t\t<p>You can now find Appcelerator documentation at <a href=\"https://docs.axway.com/\" target=\"_blank\">https://docs.axway.com/</a>. This site will be taken down in the near future.</p></div>\n        <div class=\"header\"/>\n\n        <div id=\"src-48431504\" class=\"content\">\n                        <h1>Dashboard 4.9.1  - 18 October 2016</h1>\n    <p>Dashboard 4.9.1 is a patch release, which includes behavior changes, improvements, and several bug fixes.    </p>\n    <div class=\"section section-2 \" id=\"src-48431504_Dashboard4.9.1ReleaseNote-BehaviorChanges\">\n        <h2 class=\"heading \"><span>Behavior Changes</span></h2>\n<ul class=\" \"><li class=\" \">    <p>Sign ups using addresses from temporary email providers will now be rejected    </p>\n</li></ul>    </div>\n    <div class=\"section section-2 \" id=\"src-48431504_Dashboard4.9.1ReleaseNote-Improvements\">\n        <h2 class=\"heading \"><span>Improvements</span></h2>\n<ul class=\" \"><li class=\" \">    <p>Revised error message with users whose trial plan has expired when attempting to login in through the CLI    </p>\n</li><li class=\" \">    <p>Improved display of Arrow Quick Start content    </p>\n</li><li class=\" \">    <p>Updated &quot;Switch Org&quot; button on the Manage Organization UI and fixed case where users may not be shown the option to switch from an inactive organization to an active one    </p>\n</li></ul>    </div>\n    <div class=\"section section-2 \" id=\"src-48431504_Dashboard4.9.1ReleaseNote-FixedIssues\">\n        <h2 class=\"heading \"><span>Fixed Issues</span></h2>\n<ul class=\" \"><li class=\" \">    <p>Fixed issue when some services may not be enabled for new enterprise organizations    </p>\n</li><li class=\" \">    <p>Fixed issue where apps may not be deleted    </p>\n</li><li class=\" \">    <p>Fixed issue where app team counts were not showing the correct number    </p>\n</li><li class=\" \">    <p>Fixed issue with organization provisioning message not dismissing after provision steps have been completed    </p>\n</li><li class=\" \">    <p>Fixed issue when a user role changes in the Manage Members section, the roles may not have been updated in the user&apos;s current session    </p>\n</li><li class=\" \">    <p>Fixed an issue where activated users added to an organization may still be shown as &quot;Invited&quot; in Manage Members    </p>\n</li><li class=\" \">    <p>Fixed issue with ACL search results listing only the last ten records    </p>\n</li><li class=\" \">    <p>Fixed issue where container usage shown on Billing may not be accurate    </p>\n</li></ul>    </div>\n        </div><a id=\"editButton\" href=\"https://wiki.appcelerator.org/pages/editpage.action?pageId=48431504\"><span>Edit</span></a>\n    \n        \n    </div>\n</body>\n</html>\n","title":"Dashboard 4.9.1 Release Note"});